import styled from "styled-components";
const MainWrapper = styled.section`
margin: 0 auto;
width: 1112px;
display: flex;
flex-direction: column;
align-items: center;
`
const MainTitle = styled.h2`
font-weight: 600;
font-size: 32px;
text-align: center;
`
const AdditionalTitle = styled.div`
text-align: center;
font-weight: 400;
font-size: 18px;
line-height: 26px;
    h1{
    display: inline;
    font-weight: 400;
    font-size: 18px;
    font-weight: 700;  
}
`
const FirstBlock = styled.div`
width: 100%;
height: 480px;
display: flex;
align-items: center;
justify-content: space-between;`
const InfoBlockWrapper = styled.div`
width: 475px;
display: flex;
flex-direction: column;
span{
    font-weight: 700
}
`
const InfoBlockTitle = styled.div`
font-weight: 600;
font-size: 26px;
margin-bottom: 10px;
`
const InfoBlock = styled.div`
font-weight: 400;
font-size: 14px;
line-height: 20px;
`
const FirstGraphicBlock = styled.div`
width: 545px;
display: grid;
row-gap: 14px;
grid-auto-rows: 40px;
    .first-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
    }
    .second-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
    }
    .third-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
    }
    .fourth-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
  }
    .fifth-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
  }
`;
const FirstGraphicBlockElement = styled.div`
display: flex;
justify-content: space-between;
align-items: center;
padding-left: 21px;
padding-right: 21px;
background: linear-gradient(180deg, #FFFFFF 0%, #DBDEE7 100%);
box-shadow: 0px 6px 16px rgba(0, 0, 0, 0.1);
border-radius: 20px;
font-weight: 600;
font-size: 11px;
text-transform: uppercase;
`
const ServiceDescription = () => {
    return (
        <MainWrapper>
            <MainTitle>
                What information can I find in my Vinlocator
                <br />
                vehicle history report?
            </MainTitle>
            <AdditionalTitle>
                When running a VIN, license plate, or make and model search on <h1>Vinlocator</h1>, you can expect
                <br />
                to receive a comprehensive vehicle history report that covers nearly 15 different categories. Here
                <br />
                are some examples of the reports you might receive:
            </AdditionalTitle>

            <FirstBlock>
                <FirstGraphicBlock>
                    <div className="first-row">
                        <FirstGraphicBlockElement>Number of owners</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>accidents</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>market value</FirstGraphicBlockElement>
                    </div>
                    <div className="second-row">
                        <FirstGraphicBlockElement>Photos</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>thefts</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>ownership cost</FirstGraphicBlockElement>
                    </div>
                    <div className="third-row">
                        <FirstGraphicBlockElement>specifications</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>recalls</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>warranties</FirstGraphicBlockElement>
                    </div>
                    <div className="fourth-row">
                        <FirstGraphicBlockElement>Listings</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>salvage</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>insurance</FirstGraphicBlockElement>
                    </div>
                    <div className="fifth-row">
                        <FirstGraphicBlockElement>Vehicle safety</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>license plate</FirstGraphicBlockElement>
                        <FirstGraphicBlockElement>model</FirstGraphicBlockElement>
                    </div>
                </FirstGraphicBlock>
                <InfoBlockWrapper>
                    <InfoBlockTitle>Detailed vehicle history</InfoBlockTitle>
                    <InfoBlock>At <span>Vinlocator</span>, our focus is on providing you with the most pertinent information
                        right from the start, placing it where you need it the most. In our detailed vehicle history reports
                        generated through VIN or license plate searches, we present all significant events we have gathered
                        for the specific vehicle. This includes comprehensive details on accidents, salvage records, theft
                        incidents, and sales listings.</InfoBlock>

                </InfoBlockWrapper>
            </FirstBlock>


        </MainWrapper>
    )
}
export default ServiceDescription;
